import Header from "../../components/Header";
import Message from "../../components/Message";
import StorageListCard from "../../components/StorageListCard";
import CreateStorage from "../../components/CreateStorage";
import '../../styles/main.css';
import {useState} from "react";
import {dbService} from "../../firebase";
import UrlInput from "../../components/UrlInput";
const Main = () => {
  const [urlInput, setUrlInput] = useState("");

  const onChange = (e) => {
    e.preventDefault();
    setUrlInput(e.target.value);
  }

  const onSubmit = async (e) => {
    e.preventDefault();
    await dbService.collection("jjalbang").add({
      text: urlInput,
      crateAt: Date.now(),
    });
    setUrlInput("");
  }

  return (
    <div className="main-container">
      <Header text={"짤방저장소"}/>
      <div className="main">
        <img className="main-background-img" src="imgs/cute-doodle-flower-pattern.png" alt="배경화면" />
        <div className="main-create">
          <UrlInput/>
          {/*<StorageListCard/>*/}
          {/*<CreateStorage/>*/}
          {/*<Message text="저장되었습니다." />*/}
        </div>
      </div>
    </div>
  );
};

export default Main;
